import React from "react";
import Project from "./Project";

const Portfolio = () => {
  const projects = [
    {
      name: "Events Planner",
      description: "A Python-based program that allows users to create and manage events.",
      githubUrl: "https://github.com/warbyd/Python-Project-Events-Planner",
    },
    // add more projects as needed
  ];

  return (
    <div className="portfolio">
      {projects.map((project) => (
        <Project
          key={project.githubUrl}
          name={project.name}
          description={project.description}
          githubUrl={project.githubUrl}
        />
      ))}
    </div>
  );
};

export default Portfolio;
